import { Button } from 'primereact/button';
import { Calendar } from 'primereact/calendar';
import react, { useEffect, useState } from "react";

import { ReactDOM } from 'react';
import "./index.css";
import {ZodiacSignsDetail} from './data'; 



function App(){
    const [date,setDate]=useState();

    function eventHandler(e){
        e.preventDefault();
        
        

        return
    }

    return(
        <div>
            <div><h1>Zodiac Calendar</h1></div>
            <div  className='cal'><Calendar placeholder='Choose Date' value={date} onChange={(e) => setDate(e.value) } />
            <Button label="search" severity="search" onClick={eventHandler} id='btn'/>
            </div>
         <div>
            <ul>
                <li>
                    {ZodiacSignsDetail.map((ZodiacSignsDetail)=>{
                        return ( <><li>{ZodiacSignsDetail.Name}</li>
                        <li>{ZodiacSignsDetail.MyanmarMonth} </li>
                       <li>  <img src={ZodiacSignsDetail.ZodiacSignImageUrl}/></li>
                       <h2>{ZodiacSignsDetail.Title1}</h2>
                       
                        <p>{ZodiacSignsDetail.LifePurpose}</p>
                        <h2>{ZodiacSignsDetail.Title2}</h2>
                        <p>{ZodiacSignsDetail.Loyal}</p>
                        <h2>{ZodiacSignsDetail.Title3}</h2>
                        <p>{ZodiacSignsDetail.RepresentativeFlower}</p>
                        <h2>{ZodiacSignsDetail.Title4}</h2>
                        <p>{ZodiacSignsDetail.Angry}</p>
                        <h2>{ZodiacSignsDetail.Title5}</h2>
                        <p>{ZodiacSignsDetail.Character}</p>
                        <h2>{ZodiacSignsDetail.Title6}</h2>
                        <p>{ZodiacSignsDetail.PrettyFeatures}</p>
                        
                                                </>
                        
                        );
                    })}
                </li>
            </ul>
        </div>
        </div>
        
  
    );

}

export default App;
